import styled, { css } from 'styled-components';

import mainStyle from '../../styles/main';

const {
	variables: {
		primary,
		greyDark4,
		textWhite,
		black,
		tertiaryLight,
		greyDark3,
		greyDark1,
		white,
	},
} = mainStyle;

export const HomeContainer = styled.div`
	width: 25vw;
	height: 100vh;
	background-color: ${black};
`;
